def bs(a,n,k): 
    l=0 
    h=n-1 
    while(l<=h): 
        mid=(l+h)//2
        if a[mid]==k: 
            return 1
        if a[mid]<k: 
            l=mid+1 
        else: 
            h=mid-1 
    return 0


